import React from 'react';
import movies from '../movies'
import Movie from './Movie'
function Products(){
     return (
        <>
        {movies.map((data)=> 
         
         <Movie 
           title={data.title}
           poster={data.poster}
           genre={data.genre}
         />
        )}
        </>
     )
}

export default Products;
